import { Text, View } from 'react-native'
import React from 'react'

export default class inventario{
  render() {
    return (
      <View style={{flex: 1, alignItemsi: "center", justifyContent: "center"}}>
        <Text>Inventario</Text>
      </View>
    )
  }
}
